import React, { useState, useRef } from 'react';
import { Box, Card, CardContent, CardMedia, Typography, IconButton, Container } from '@mui/material';
import ThumbUpIcon from '@mui/icons-material/ThumbUp';
import ThumbDownIcon from '@mui/icons-material/ThumbDown';
import PersonIcon from '@mui/icons-material/Person';

const ContentView = () => {
  // Mock data remains the same
  const contentItems = [
    {
      id: 1,
      type: 'video',
      title: 'Best Places in Brooklyn',
      creator: 'Travel Guide',
      thumbnail: 'https://via.placeholder.com/300x200',
      upvotes: 124,
      downvotes: 5
    },
    // ... other items
  ];

  const [currentIndex, setCurrentIndex] = useState(0);
  const containerRef = useRef(null);
  const [touchStart, setTouchStart] = useState(null);

  // Scroll and touch handlers remain the same
  const handleScroll = (event) => {
    const deltaY = event.deltaY;
    if (deltaY < 0 && currentIndex < contentItems.length - 1) {
      setCurrentIndex(prev => prev + 1);
    } else if (deltaY > 0 && currentIndex > 0) {
      setCurrentIndex(prev => prev - 1);
    }
  };

  const handleTouchStart = (e) => {
    setTouchStart(e.touches[0].clientY);
  };

  const handleTouchMove = (e) => {
    if (!touchStart) return;
    const touchEnd = e.touches[0].clientY;
    const deltaY = touchStart - touchEnd;
    if (Math.abs(deltaY) > 50) {
      if (deltaY > 0 && currentIndex < contentItems.length - 1) {
        setCurrentIndex(prev => prev + 1);
      } else if (deltaY < 0 && currentIndex > 0) {
        setCurrentIndex(prev => prev - 1);
      }
      setTouchStart(null);
    }
  };

  const currentItem = contentItems[currentIndex];

  return (
    <Container maxWidth="sm" disableGutters>
      <Box
        ref={containerRef}
        sx={{
          height: 'calc(100vh - 160px)', // Height minus header and bottom nav
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          overflow: 'hidden',
          position: 'fixed',
          left: '50%',
          transform: 'translateX(-50%)',
          width: '100%',
          maxWidth: 'sm'
        }}
        onWheel={handleScroll}
        onTouchStart={handleTouchStart}
        onTouchMove={handleTouchMove}
      >
        <Card
          sx={{
            width: '100%',
            maxHeight: '90%',
            display: 'flex',
            flexDirection: 'column',
            m: 2,
            position: 'relative',
            borderRadius: 2,
            bgcolor: 'background.paper',
            boxShadow: 3
          }}
        >
          {(currentItem.type === 'video' || currentItem.type === 'image') && (
            <CardMedia
              component="img"
              sx={{
                width: '100%',
                height: 'auto',
                maxHeight: '60vh',
                objectFit: 'contain'
              }}
              image={currentItem.type === 'video' ? currentItem.thumbnail : currentItem.imageUrl}
              alt={currentItem.title}
            />
          )}
          <CardContent sx={{ flexGrow: 1, position: 'relative', pb: 8 }}>
            <Typography variant="h6" gutterBottom>
              {currentItem.title}
            </Typography>
            {currentItem.type === 'blog' && (
              <Typography variant="body2" color="text.secondary">
                {currentItem.content}
              </Typography>
            )}
            <Box
              sx={{
                position: 'absolute',
                bottom: 0,
                left: 0,
                right: 0,
                p: 2,
                bgcolor: 'background.paper',
                borderTop: 1,
                borderColor: 'divider',
                display: 'flex',
                justifyContent: 'space-between',
                alignItems: 'center'
              }}
            >
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <PersonIcon color="action" fontSize="small" />
                <Typography variant="body2" color="text.secondary">
                  {currentItem.creator}
                </Typography>
              </Box>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <IconButton size="small">
                  <ThumbUpIcon fontSize="small" />
                </IconButton>
                <Typography variant="body2">{currentItem.upvotes}</Typography>
                <IconButton size="small">
                  <ThumbDownIcon fontSize="small" />
                </IconButton>
                <Typography variant="body2">{currentItem.downvotes}</Typography>
              </Box>
            </Box>
          </CardContent>
        </Card>
      </Box>
    </Container>
  );
};

export default ContentView;
